import React from "react";

const MovieDetails = ({
  movieIdSelected,
  onCloseMovie,
}) => {
  return (
    <div className='details'>
      <button className='byn-back'>&larr;</button>
      {movieIdSelected}
    </div>
  );
};

export default MovieDetails;
